import React from 'react';
import './navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';


const navbar = () => {
    return ( 
        <div className={'Navbar'}>
            <div>logo</div>
            <div className={'NavLinks'}>
                <div>Home</div>
                <div>Features</div>
                <div>Pricing</div>
            </div>
        </div>
     );
}

export default navbar;
